			shellPath = /bin/sh;
			shellScript = "# 使用前可以先手动安装工具,提升速度\n# 由于GrowingIOTest链接工程较多,费事较长\n# //1. 先拉下专案\n# brew tap growingio/homebrew-oclint\n# //2. 然后安装库\n# brew install oclint-growing\n# //3. gem install xcpretty\n\n# 关于检测结果，最终可以过滤 GrowingIOCodeChecker 来查看检测的错误\n\nexport HOMEBREW_NO_AUTO_UPDATE=true\nexport LC_ALL=en_US.UTF-8\nexport LANG=en_US.UTF-8\n\n# 0. 检测brew工具\nif which brew 2>/dev/null; then\necho 'brew already installed'\nelse # install oclint\necho 'brew not install,exit!'\nexit 0;\nfi\n\n# 如果没有安装最好翻墙，不然会很慢\n# 1. 环境配置，判断是否安装oclint-growing，没有则安装\nif which oclint 2>/dev/null; then\necho 'oclint-growing already installed'\nelse # install oclint\nbrew tap growingio/homebrew-oclint\nbrew install oclint-growing\nfi\n\n# 2. 环境配置，判断是否安装xcpretty，没有则安装\nif which xcpretty 2>/dev/null; then\necho 'xcpretty already installed'\nelse\necho 'xcpretty need permissions,please enter sudo gem install xcpretty in your terminal,exit!'\nexit 0;\nfi\n\n\nunset LLVM_TARGET_TRIPLE_SUFFIX\n\ncd ${SRCROOT}\n\nCOMPILE_JSON=${SRCROOT}/compile_commands.json\n\necho \"==== json file : $COMPILE_JSON ====\"\n\nif [[ -f $COMPILE_JSON ]]; then\n    #statements\n    echo \"remove $COMPILE_JSON\"\n    rm -r $COMPILE_JSON\n    \nfi\n\n#echo \"[]\" > $COMPILE_JSON\necho \"==== Root Path : ${SRCROOT} ====\"\n# 生成编译配置文件，oclint使用clang分析的话，需要知道编译环境，这里就是生成编译环境的一个环节\n# 1.workspace的编译\n#xcodebuild clean -workspace Growing.xcworkspace -scheme GrowingIOTest -configuration Release -arch armv7 -sdk iphoneos13.5\n#xcodebuild -workspace Growing.xcworkspace -scheme GrowingIOTest -configuration Release -arch armv7 -sdk iphoneos13.5 COMPILER_INDEX_STORE_ENABLE=NO | xcpretty -r json-compilation-database --output compile_commands.json\n\n# 2.默认target编译\nxcodebuild clean\nxcodebuild COMPILER_INDEX_STORE_ENABLE=NO | xcpretty -r json-compilation-database --output compile_commands.json\necho \"==== start xcpretty ====\"\n\necho \"==== oclint-json-compilation-database start ====\"\n\n\noclint-json-compilation-database -e Pods -v -- -report-type xcode -rc LONG_LINE=1000 -rc SHORT_VARIABLE_NAME=1 -rc CYCLOMATIC_COMPLEXITY=30 -rc CYCLOMATIC_COMPLEXITY=1500 -rc NCSS_METHOD=500 -rc LONG_METHOD=100 -rc LONG_VARIABLE_NAME=100 -rc GIO_METHOD_ALLOW_UPPERCASE=\"URL,FMG3DB,TXT,UTF,STM\" -max-priority-1=99999 -max-priority-2=99999 -max-priority-3=99999 -rc GIO_CATEGORY_PREFIX=Growing -rc GIO_CLASS_PREFIX=Growing\n";
